INSERT INTO `cmdb_asset_extend_template` VALUES (34, '模板类型', '3d机房', '{\r\n   \"displayname\":\"机房\"\r\n}', '{\"unique\": 0, \"datatype\": 5, \"required\": 0, \"datasource\": 2, \"datasourceparam\": {\"sql\": \"SELECT el.equipment_id as id, r.name,CONCAT(\'机柜区:\', ra.name ,\',机柜排:\',  rar.name ,\',安装点:\', mp.name,\',机柜:\', rk.name , \',起始U:\', el.start_u ) as `desc`\r\nFROM machine_room r, machine_room_area ra, machine_room_area_row rar, mount_point mp, rack rk, equipment_location el \r\nWHERE el.rack_id = rk.id AND rk.mount_point_id = mp.id AND mp.machine_room_area_row_id = rar.id AND rar.machine_room_area_id = ra.id AND ra.machine_room_id = r.id\r\nand el.equipment_id is not null {params};\", \"datasourcetype\": 0\r\n				 ,\"params\":[\r\n						 {\"where\":\" and el.equipment_id={0}\",\"value\":\"\",\"key\":\"assetId\",\"type\":\"field\"}\r\n				 ]\r\n}}', '{\r\n    \"excel_field_name\":\"机房\",\r\n    \"excel_field_order\":3,\r\n    \"excel_sheet_name\":\"default\",\r\n    \"excel_show\":0,\r\n    \"excel_group\":1\r\n}', '{}', '', NULL, NULL, NULL, NULL);
