INSERT INTO `cmdb_asset_extend_template` VALUES (29044, '存储', 'machineroom', '{\n  \"displaytype\": \"label\",\n  \"subgroup\": 50,\n  \"displayname\": \"所在机房\",\n  \"columnshoworder\": 110,\n  \"displayorder\": 410,\n  \"placeholder\": \"所在机房\",\n  \"showdesc\": 3,\n  \"columnshow\": 1,\n  \"groupname\": \"资产属性\",\n  \"can_update\": 0,\n  \"is_show\": 1\n}', '{\n  \"datasourceparam\": {\n    \"datasourcetype\": 0,\n    \"params\": [\n      {\n        \"where\": \" and el.equipment_id={0}\",\n        \"type\": \"field\",\n        \"value\": \"\",\n        \"key\": \"assetId\"\n      }\n    ],\n    \"sql\": \"SELECT el.equipment_id as id, r.name,CONCAT(\'机柜区:\', ra.name ,\',机柜排:\',  rar.name ,\',安装点:\', mp.name,\',机柜:\', rk.name , \',起始U:\', el.start_u ) as `desc`\\r\\nFROM machine_room r, machine_room_area ra, machine_room_area_row rar, mount_point mp, rack rk, equipment_location el \\r\\nWHERE el.rack_id = rk.id AND rk.mount_point_id = mp.id AND mp.machine_room_area_row_id = rar.id AND rar.machine_room_area_id = ra.id AND ra.machine_room_id = r.id\\r\\nand el.equipment_id is not null {params};\"\n  },\n  \"datatype\": 5,\n  \"datasource\": 2,\n  \"unique\": 0,\n  \"required\": 0\n}', '{\n  \"excel_field_name\": \"所在机房\",\n  \"excel_group\": 1,\n  \"excel_show\": 0,\n  \"excel_sheet_name\": \"default\",\n  \"excel_field_order\": 3\n}', '{}', '', NULL, NULL, 'superAdmin', '2020-11-02 18:35:03');
