INSERT INTO `cmdb_asset_extend_template` VALUES (29187, '网络安全监测防御设备', 'purContractNumber', '{\"can_update\": 1, \"columnshow\": 0, \"displayname\": \"采购合同名称\", \"displayorder\": 310, \"groupname\": \"资产属性\", \"is_show\": 1, \"placeholder\": \"采购合同编号\", \"showdesc\": 3, \"subgroup\": 35}', '{\"datatype\":5,\r\n\"unique\":0,\r\n\"required\":0,\r\n\"datasource\":2,\r\n\"datasourceparam\":\r\n{\"datasourcetype\":0,\"sql\":\"select pc.id,pc.contract_name as name\r\n,CONCAT(\'信息化建设项目编号:\',ifnull(project_code,\'\'),\',信息化建设项目名称:\',ifnull(project_name,\'\'),\',采购日期:\',ifnull(contract_signed_date,\'\'),\',供货商:\',ifnull(c.company_name,\'\')) as `desc`\r\nfrom  project_information_contract pc\r\nleft join project_information_plan p on p.id=pc.information_project_plan_id\r\nleft join sys_company c on pc.contractor_company_id=c.company_id\"}}', '{\"excel_field_name\": \"采购合同名称\", \"excel_field_order\": 310, \"excel_group\": 1, \"excel_sheet_name\": \"default\", \"excel_show\": 1}', '{}', '', NULL, NULL, NULL, NULL);
INSERT INTO `cmdb_asset_extend_template` VALUES (29188, '网络安全监测防御设备', 'serviceContractNumber', '{\n  \"subgroup\": 40,\n  \"displayname\": \"维保服务合同名称\",\n  \"displayorder\": 340,\n  \"placeholder\": \"请选择\",\n  \"showdesc\": 3,\n  \"columnshow\": 0,\n  \"groupname\": \"资产属性\",\n  \"can_update\": 1,\n  \"is_show\": 1\n}', '{\n  \"datasourceparam\": {\n    \"datasourcetype\": 0,\n    \"sql\": \"select p.id,project_name as name  , CONCAT(\'维保年度:\',IFNULL(project_year,\'\'),\',维保服务商:\',IFNULL(c.company_name,\'\'),\',维保服务商联系电话:\',IFNULL(c.phone,\'\') ,\',维保服务商联系人:\',IFNULL(s.`name`,\'\'),\',维保服务商联系人电话:\',IFNULL(s.`telephone`,\'\')) as `desc`  from project_operation_and_maintenance p  LEFT JOIN sys_company c on c.company_id= p.contractor_company_id  LEFT JOIN sys_staff s on s.staff_id=p.contractor_id  where classification=1\"\n  },\n  \"datatype\": 5,\n  \"datasource\": 2,\n  \"unique\": 0,\n  \"required\": 0\n}', '{\n  \"excel_field_name\": \"维保服务合同名称\",\n  \"excel_group\": 1,\n  \"excel_show\": 1,\n  \"excel_sheet_name\": \"default\",\n  \"excel_field_order\": 340\n}', '{}', '', NULL, NULL, 'superAdmin', '2020-11-12 10:58:58');
