INSERT INTO `cmdb_asset_extend_template` VALUES (574286, 'export_device', 'RecipientsDepartment', '{\n  \"subgroup\": 45,\n  \"displayname\": \"领用部门\",\n  \"columnshoworder\": 130,\n  \"refreshFields\": \"RecipientsStaff\",\n  \"displayorder\": 110,\n  \"placeholder\": \"请选择\",\n  \"columnshow\": 1,\n  \"groupname\": \"资产属性\",\n  \"can_update\": 1,\n  \"is_show\": 1\n}', '{\n  \"datasourceparam\": {\n    \"datasourcetype\": 0,\n    \"params\": [\n      {\n        \"where\": \" and company_id={0}\",\n        \"type\": \"field\",\n        \"value\": \"\",\n        \"key\": \"RecipientsCompany\"\n      }\n    ],\n    \"sql\": \"select org_id as id,org_name as name from sys_org where `status`=0 {params};\"\n  },\n  \"datatype\": 5,\n  \"datasource\": 2,\n  \"unique\": 0,\n  \"required\": 0\n}', '{\n  \"excel_field_name\": \"领用部门\",\n  \"excel_group\": 1,\n  \"excel_show\": 1,\n  \"excel_sheet_name\": \"default\",\n  \"excel_field_order\": 380\n}', '{}', NULL, 'superAdmin', '2020-11-21 10:49:36', 'superAdmin', '2020-11-21 10:49:36');
INSERT INTO `cmdb_asset_extend_template` VALUES (574287, 'export_device', 'OperationalStaff', '{\n  \"columnshoworder\": 140,\n  \"subgroup\": 30,\n  \"displayname\": \"运维负责人\",\n  \"displayorder\": 120,\n  \"placeholder\": \"请选择\",\n  \"showdesc\": 1,\n  \"columnshow\": 1,\n  \"groupname\": \"资产属性\",\n  \"can_update\": 1,\n  \"is_show\": 1\n}', '{\n  \"datasourceparam\": {\n    \"datasourcetype\": 0,\n    \"params\": [\n      {\n        \"where\": \" (company_id={0} and org_id is null)\",\n        \"type\": \"field\",\n        \"value\": \"\",\n        \"key\": \"OperationalCompany\"\n      },\n      {\n        \"where\": \" or org_id={0}\",\n        \"type\": \"field\",\n        \"value\": \"\",\n        \"key\": \"OperationalDepartment\"\n      }\n    ],\n    \"sql\": \"select staff_id as id,`name`,CONCAT(\'运维人联系电话:\',telephone) as `desc` from sys_staff where `status`=0 and ({params});\"\n  },\n  \"datatype\": 5,\n  \"datasource\": 2,\n  \"unique\": 0,\n  \"required\": 1\n}', '{\n  \"excel_field_name\": \"运维负责人\",\n  \"excel_group\": 1,\n  \"excel_show\": 1,\n  \"excel_sheet_name\": \"default\",\n  \"excel_field_order\": 300\n}', '{}', NULL, 'superAdmin', '2020-11-21 10:50:54', 'superAdmin', '2020-11-21 10:50:54');
INSERT INTO `cmdb_asset_extend_template` VALUES (574290, '软件资产', 'serviceContractNumber', '{\n  \"subgroup\": 10,\n  \"displayname\": \"服务合同名称\",\n  \"displayorder\": 70,\n  \"placeholder\": \"请选择\",\n  \"showdesc\": 3,\n  \"columnshow\": 0,\n  \"groupname\": \"管理信息\",\n  \"can_update\": 1,\n  \"is_show\": 1\n}', '{\n  \"datasourceparam\": {\n    \"datasourcetype\": 0,\n    \"sql\": \"select p.id,plan.project_name as name, CONCAT(\'服务合同编号:\',IFNULL(p.`contract_number`,\'\'),\',项目编号:\',IFNULL(plan.`project_code`,\'\'),\',项目名称:\',IFNULL(plan.`project_name`,\'\'),\',服务商:\',IFNULL(c.`company_name`,\'\'),\',服务开始时间:\',IFNULL(CONCAT(plan.project_year,\'-01-01\'),\'\'),\',服务到期时间:\',IFNULL(CONCAT(plan.project_year,\'-12-31\'),\'\'),\',服务商联系人:\',IFNULL(s.`name`,\'\'),\',服务商联系人电话:\',IFNULL(s.`telephone`,\'\')) as `desc`  from project_information_contract p  LEFT JOIN sys_company c on c.company_id= p.contractor_company_id LEFT JOIN sys_staff s on s.staff_id=p.contractor_id LEFT JOIN project_information_plan plan on plan.id=p.information_project_plan_id\"\n  },\n  \"datatype\": 5,\n  \"datasource\": 2,\n  \"unique\": 0,\n  \"required\": 0\n}', '{\n  \"excel_field_name\": \"服务合同名称\",\n  \"excel_group\": 1,\n  \"excel_show\": 1,\n  \"excel_sheet_name\": \"default\",\n  \"excel_field_order\": 340\n}', '{}', NULL, 'superAdmin', '2020-11-30 15:50:59', 'superAdmin', '2020-12-03 09:10:21');
