INSERT INTO `cmdb_asset_extend_template` VALUES (609418, 'export_all', '所在主机', '{\n  \"displaytype\": \"label\",\n  \"columnshoworder\": 13,\n  \"subgroup\": 30,\n  \"displayname\": \"所在主机\",\n  \"displayorder\": 300,\n  \"placeholder\": \"请选择\",\n  \"showdesc\": 2,\n  \"columnshow\": 0,\n  \"groupname\": \"物资属性\",\n  \"can_update\": 0,\n  \"is_show\": 0\n}', '{\n  \"datasourceparam\": {\n    \"datasourcetype\": 0,\n    \"params\": [\n      {\n        \"where\": \" and asset_extend_value like \'%{0}%\'\",\n        \"type\": \"field\",\n        \"value\": \"\",\n        \"key\": \"hostSN\"\n      }\n    ],\n    \"sql\": \"select asset_id as id,asset_id as name,CONCAT(\'所在主机类型:\',(select asset_type from cmdb_asset where cmdb_asset.id=asset_id),\',所在主机名称:\',(select json_unquote(JSON_Extract( t1.asset_extend_value,\'$.valueorigin\')) from cmdb_asset_extend t1 where t1.asset_id=t.asset_id and t1.asset_extend_key=\'assetName\')) as `desc` from cmdb_asset_extend t where asset_extend_key=\'virtual_machine\' {params};\"\n  },\n  \"datatype\": 5,\n  \"datasource\": 2,\n  \"unique\": 0,\n  \"required\": 0\n}', '{\"excel_field_name\": \"所在主机\", \"excel_field_order\": 300, \"excel_group\": 1, \"excel_sheet_name\": \"default\", \"excel_show\": 0}', '{}', NULL, NULL, NULL, NULL, NULL);
